var CrpytoJS = require('crypto-js'); //需要cnpm install crypto-js才能安装依赖。。。。。。。。。。。。。。。。。。。。。


function GetDecryptedData(t) {
    var f = CrpytoJS.enc.Utf8.parse("jo8j9wGw%6HbxfFn");
    var f = CrpytoJS.enc.Utf8.parse("Dt8j9wGw%6HbxfFn");
    var m = CrpytoJS.enc.Utf8.parse("0123456789ABCDEF");
    var e = CrpytoJS.enc.Hex.parse(t);
    var n = CrpytoJS.enc.Base64.stringify(e);
    var a = CrpytoJS.AES.decrypt(n, f, {iv: m, 
      mode: CrpytoJS.mode.CBC,
      padding: CrpytoJS.pad.Pkcs7 
    });
    var r = a.toString(CrpytoJS.enc.Utf8);
    return r.toString();
}

 var t = "";
var result = JSON.parse(GetDecryptedData(t));
console.log(result);